### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Software Requirements
- **Non-functional requirements**: Define quality parameters of a system.
- **Functional requirements**: Define what the system should do.

#### 2. Partition Testing
- **Complete and Disjoint Partitions**: Partitions cover all possible inputs without overlap.
- **Complete but not Disjoint Partitions**: Partitions cover all possible inputs but may overlap.
- **Disjoint but not Complete Partitions**: Partitions do not overlap but do not cover all possible inputs.

#### 3. Logical Predicates
- **Tautology**: A predicate that is always true.
- **Satisfiable**: A predicate that can be true for some inputs.
- **Predicate Analysis**: Understanding logical expressions and their truth values.

#### 4. Code Coverage Criteria
- **Condition and All Combinations Coverage (CACC)**: Ensuring all conditions and their combinations are tested.
- **Restricted Inactive Clause Coverage (RICC)**: Ensuring inactive clauses are tested under specific conditions.
- **All Def Coverage**: Ensuring every definition of a variable is executed.
- **All Use Coverage**: Ensuring every use of a variable is executed.
- **All DU Path Coverage**: Ensuring every definition-use pair for a variable is executed.

#### 5. Symbolic Execution
- **Path Constraints**: Conditions that must be satisfied for a specific path in the code to be executed.
- **Symbolic Testing**: Using symbolic values to test different paths in the code.

#### 6. Input Space Partitioning (ISP)
- **Characteristics and Blocks**: Dividing input space into blocks based on characteristics.
- **Base Choice Coverage (BCC)**: Ensuring all base choices are covered in testing.
- **All Combinations Coverage (ACoC)**: Ensuring all combinations of input blocks are tested.

#### 7. Control Flow Graph (CFG)
- **Vertices and Edges**: Representing the flow of control in a program.
- **Linearly Independent Paths**: Paths that are independent of each other.
- **Edge-Pair Coverage**: Ensuring all pairs of edges are tested.

#### 8. Testing Techniques
- **White-Box Testing**: Testing based on the internal logic of the code.
  - **Unit Testing**: Testing individual components.
  - **Integration Testing**: Testing the interaction between components.

